        setActualizado()
    }

    return (
        < div className="gastos-realizados" >
            <h2>Listado</h2>
            {
                gastos.map(gasto => (
                    <Gasto
                        key={gasto.id}
                        gasto={gasto}
                    />
                ))
            }
        </div >
    )
}



